def extract_from_zip(file_name):
    images = {}
    myfile = zipfile.ZipFile(file_name)
    for i in myfile.infolist():
        file = myfile.open(i)  
        img = Image.open(file).convert('RGB')
        images[i.filename] = {"pil-image":img}
    return images

